import ChatBot from "react-simple-chatbot";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="card-container">
        <ChatBot
          steps={[
            {
              id: "0",
              message: "Welcome To ClaimBot",
              trigger: "1",
            },

            {
              id: "1",
              message: "would yo like to see if you have a claim",
              trigger: "1",
            },

            {
              id: "2",
              options: [
                { value: 1, label: "Yes", trigger: "3" },
                { value: 2, label: "No", trigger: "4" },
              ],
            },

            {
              id: "3",
              message: "Then First Question",
              trigger: "5",
            },
            {
              id: "4",
              message: "GoodBye ",
              end: true,
            },
            {
              id: "5",
              message: "Then Second Question",
              trigger: "1",
            },
          ]}
        />
      </div>
    </div>
  );
}

export default App;
